import "antd/dist/antd.css";
import styled from "styled-components";

const ParentWrapper = styled.div`
  display: flex;
  flex-direction: row;
  width: 100%;
`;

const Wrapper = styled.div`
  width: ${(props) => props.width};
  display: flex;
`;

const Cyworld = ({ Component }) => {
  return (
    <>
      <Component />
    </>
  );
};

export default Cyworld;
